export const Lightbox = () => {
    return (
        <div className='nivo-lightbox-overlay nivo-lightbox-theme-default nivo-lightbox-effect-slideDown'>
            <div className='nivo-lightbox-wrap'>
                <div className='nivo-lightbox-content'></div>
                <div className='nivo-lightbox-title-wrap'>
                    <span className='nivo-lightbox-title'>Project Title</span>
                </div>
            </div>
            <a href='#' className='nivo-lightbox-close' title='Close'>Close</a>
        </div>
    )
}
